import React, {useState, useEffect} from "react"
import ManageEditor from "./ManageEditor";
import ManageList from "./ManageList";
import './App.css';

const dummylist = [
  {id:1,
    food:"치킨",
    kcal:300,
    date:new Date().getTime()
  },
  {id:2,
    food:"떡볶이",
    kcal:200,
    date:new Date().getTime()
  },
  {id:3,
    food:"씨리얼",
    kcal:100,
    date:new Date().getTime()
  },
]

const App = () => {
  return(
    <div className="App">
      <ManageEditor />
      <ManageList manageList={dummylist}  />
    </div>
  );
}

export default App;
